     "type": "boolean"
    },
    "hostnameType": {
     "type": "string"
    },
    "ipv6CIDRBlock": {
     "description": "The IPv6 network range for the subnet, in CIDR notation. The subnet size\nmust use a /64 prefix length.\n\n\nThis parameter is required for an IPv6 only subnet.",
     "type": "string"
    },
    "ipv6Native": {
     "description": "Indicates whether to create an IPv6 only subnet.",
     "type": "boolean"
    },
    "mapPublicIPOnLaunch": {
     "type": "boolean"
    },
    "outpostARN": {
     "description": "The Amazon Resource Name (ARN) of the Outpost. If you specify an Outpost\nARN, you must also specify the Availability Zone of the Outpost subnet.",
     "type": "string"
